import React from "react"
import { Todo } from "../types";
import Modal from "./Modal";
import { DesktopModalContainer, Header } from "./ModalPopup.styles";

interface BaseModalWrapper {
  isModalVisible: boolean;
  onBackdropClick: () => void;
  todo: Todo
}


const BaseModelWrapper = (props: BaseModalWrapper) => {
  if (!props.isModalVisible) {
    return null
  }

  return (
    <Modal onBackDropClick={props.onBackdropClick}>
      <DesktopModalContainer>
        <Header>Modal info</Header>
      </DesktopModalContainer>

    </Modal>
  )
}

export default BaseModelWrapper
